import {React,useState} from 'react'

function Home() {
  const [value,setvalue]=useState(0);
  const increment=(e)=>{
       setvalue(value+1);
  }
  const decrement=(e)=>{
        setvalue(value-1);
  }
  return (
    <div>
      <h1>Hello</h1>
      <input  placeholder='Enter value' value={0} />
      <button onClick={increment}>+</button>
      <button onClick={decrement}>-</button>
    </div>
  )
}

export default Home
